import { View, StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  bar: {
    alignSelf: 'stretch',
    height: 52,
    flexDirection: 'row', // row
    backgroundColor: 'yellow',
    alignItems: 'center',
    justifyContent: 'space-between', // center, space-around
    paddingLeft: 10,
    paddingRight: 10
  }
});

const TopBar = () =>
  <View style={styles.bar}>
    <Text>Left</Text>
    <Text>TopBar</Text>
    <Text>Right</Text>
  </View>;

export { TopBar };
